<script>
    (function() {
        const width = 750;
        const height = 990;
        const canvas = document.getElementById('canvas');
        canvas.setAttribute('width', width);
        canvas.setAttribute('height', height);
        const N = 25;
        const context = canvas.getContext('2d');

        context.lineWidth = 0.4;
        context.strokeStyle = 'rgba(34,102,254,0.58)';

        var y = N/2;
        while (y < height) {
            context.beginPath();
            context.moveTo(0, y);
            context.lineTo(width, y);
            context.stroke();
            y += N;
        }
        var x = N/2;
        while (x < width) {
            context.beginPath();
            context.moveTo(x, 0);
            context.lineTo(x, height);
            context.stroke();
            x += N;
        }
    })();
</script>
